import { useState } from "react";
import Home from "./Home";
import SignIn from "./SignIn";

function Root() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  return (
    <div className="Root">
      {isAuthenticated ? <Home /> : <SignIn />}
    </div>
  );
}

export default Root;
